package xtu.cie.ldj;

public class WildcardMatching {
	// use DP
	public boolean isMatch(String s, String p) {
		int sLen = s.length(), pLen = p.length();
		int countStars = 0;
		for (int i = 0; i < pLen; i++) {
			if (p.charAt(i) == '*')
				countStars++;
		}
		if (countStars == 0 && sLen != pLen)
			return false;
		else if (pLen - countStars > sLen)
			return false;

		boolean[] match = new boolean[sLen + 1];
		match[0] = true;
		for (int i = 0; i < sLen; i++) {
			match[i + 1] = false;
		}
		for (int i = 0; i < pLen; i++) {
			if (p.charAt(i) == '*') {
				for (int j = 0; j < sLen; j++) {
					match[j + 1] = match[j] || match[j + 1];
				}
			} else {
				for (int j = sLen - 1; j >= 0; j--) {
					match[j + 1] = (p.charAt(i) == '?' || p.charAt(i) == s
							.charAt(j)) && match[j];
				}
				match[0] = false;
			}
		}
		return match[sLen];
	}

	public boolean isMatch_2(String s, String p) {
		int sInd = 0, pInd = 0;
		int match = 0, startIdx = -1;
		while (sInd < s.length()) {
			if (pInd < p.length()
					&& (p.charAt(pInd) == '?' || p.charAt(pInd) == s
							.charAt(sInd))) {
				sInd++;
				pInd++;
			} else if (pInd < p.length() && p.charAt(pInd) == '*') {
				startIdx = pInd;
				match = sInd;
				pInd++;
			} else if (startIdx != -1) {
				pInd = startIdx + 1;
				match++;
				sInd = match;
			} else {
				return false;
			}
		}
		while (pInd < p.length() && p.charAt(pInd) == '*')
			pInd++;
		return pInd == p.length();
	}

	public static void main(String[] args) {
		WildcardMatching wildcardMatching = new WildcardMatching();

		System.out
				.println(wildcardMatching
						.isMatch(
								"",
								"**"));
	}
}
